  false,\n\t\"url\": null,\n\t\"notes\": \"OBJECTIVES: The overall objective was to
  determine if CIR digital aerial photography could be used to efficiently map and
  analyze common invasive plant distribution in six NWRs in southern Illinois, southern
  Indiana, and southwest Missouri. The results will be used as a model to determine
  the best parameters for spatial resolutions (inches/pixel) and ideal timeframes
  for detecting specific invasive plants with the use of aerial CIR photography.\",\n\t\"license_title\":
